import { NgModule } from '@angular/core';
import { CommonModule } from '@angular/common';

import { HomeRoutingModule } from './home-routing.module';
export { HomeComponent } from 'src/app/components/home/home.component';
export { OfertasNovedadesComponent } from 'src/app/components/ofertas-novedades/ofertas-novedades.component';
export { PlatosVendidosComponent } from 'src/app/components/platos-vendidos/platos-vendidos.component';
export { SlideCarouselComponent } from 'src/app/components/slide-carousel/slide-carousel.component';


@NgModule({
  declarations: [
    SlideCarouselComponent
  ],
  imports: [
    CommonModule,
    HomeRoutingModule
  ]
})
export class HomeModule { }
